// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmTime 
} from '@vime/core';

import { define } from '../lib';


define('vm-time', VmTime);


export interface TimeProps extends JSX.VmTime, HTMLAttributes<HTMLVmTimeElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmTimeElement, TimeProps>(
  'vm-time',
  new Set(['label','seconds','alwaysShowHours']),
);
